import React from 'react';
import {
  Container,
  Typography,
  Card,
  CardContent,
  Grid,
} from '@mui/material';

const newsData = [
  {
    title: 'UPSC Prelims Results 2025 Declared',
    date: 'Aug 1, 2025',
    desc: 'Candidates can check results at upsc.gov.in. Mains to be held in Oct 2025.',
  },
  {
    title: 'JEE Advanced 2025 Dates Announced',
    date: 'July 30, 2025',
    desc: 'Exam will be conducted on May 18, 2025. Application starts Jan 15.',
  },
];

const NewsPage = () => {
  return (
    <Container sx={{ mt: 5 }}>
      <Typography variant="h4" fontWeight="bold" gutterBottom>
        Exam News & Updates ðŸ“°
      </Typography>
      <Grid container spacing={3}>
        {newsData.map((item, index) => (
          <Grid item xs={12} sm={6} key={index}>
            <Card elevation={3}>
              <CardContent>
                <Typography variant="h6" fontWeight="bold">
                  {item.title}
                </Typography>
                <Typography variant="body2" color="text.secondary" gutterBottom>
                  {item.date}
                </Typography>
                <Typography>{item.desc}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default NewsPage;
